export default {
    name: 'relation',
    data () {
        return {
            modals: false,
            grid: {
                xl: 12,
                lg: 12,
                md: 12,
                sm: 24,
                xs: 24
            }
        }
    },
    methods: {
        // 关闭模态框
        handleReset () {
            this.modals = false;
        },
        // 表格搜索
        userSearchs () {
            this.getList();
        },
        // 任务列表
        getList () {
            this.loading = true;
            taskListApi(this.levelId, this.levelFrom).then(async res => {
                let data = res.data
                this.levelLists = data.list;
                this.total = res.data.count;
                this.loading = false;
            }).catch(res => {
                this.loading = false;
                this.$Message.error(res.msg);
            })
        },
        pageChange (index) {
            this.levelFrom.page = index;
            this.getList();
        },
    }
}
